import React, { useState } from "react";
import styles from "./robot.module.css";
import addShoppingCar from "../../assets/images/addShopingCar.svg";
import { CartItem, Goods } from "../../interfaceList";

interface humanProps {
  id: number;
  name: string;
  email: string;
}

const Robot: React.FC<humanProps> = ({ id, name, email }) => {
  const [goods, setgoods] = useState<Goods>();

  const randomNumber = Math.floor(Math.random() * 1000);
  const price = <p>price: {randomNumber}</p>;
  const url = `https://robohash.org/${id}`;

  return (
    <ul>
      <li className={styles.frame}>
        <img src={url}></img>
        <p>{name}</p>
        <p>{email} </p>
        {price}
        <a
          href="#"
          className={styles.a}
          onClick={() => setgoods({ id, name, price: randomNumber, img: url })}
        >
          buy
        </a>
        <img
          src={addShoppingCar}
          alt="logo"
          className={styles.addShoppingCar}
        />
      </li>
    </ul>
  );
};

export default Robot;
